import React, { Component } from 'react'
import { Container } from "@material-ui/core";
import storePic from '../../assets/img/veg.jpg'

const styles ={
    page:{
        padding: 0,
        backgroundImage: `url()`
    }
}

export default class Home extends Component {
    render() {
        return (
            <div id='home' style={{padding: 0, backgroundImage:`url(${storePic})`}}>
            </div>
        )
    }
}
